class Solution(object):
    def lnrsmap(self, s):
        if s is None or len(s) == 0:
            return s

        m = {s[0]:1}
        dp = [0] * len(s)
        dp [0] = 1
        index = max_len = 0

        for i in range(1, len(s)):
            if s[i] in m:
                dp[i] = i-m[s[i]]
                index = m[s[i]] + 1
            else:
                dp[i] = dp[i-1] + 1
            m[s[i]] = i

            if max_len < dp[i]:
                max_len = dp[i]
                last = i-index+1

        print("max_len is:", max_len)
        print("max substring is:", s[index:index+max_len])
        return max_len

    def length_of_longest_substring_bad(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_dict = {"len":0,"str":""}
        length = len(s)

        for first in range(length):
            if length-1-first < max_dict["len"]:
                break
            tmp = s[first]
            for sec in range(first+1, length):
                if s[sec] not in tmp:
                    tmp += s[sec]
                    if len(tmp) > max_dict["len"]:
                        max_dict["len"] = len(tmp)
                        max_dict["str"] = tmp
                else:
                    if len(tmp) <= max_dict["len"]:
                        break
                    else:
                        max_dict["len"] = len(tmp)
                        max_dict["str"] = tmp
                        break
        return max_dict["len"]

    def length_of_longest_substring(self, s):
        used_char = {}
        start = max_len = 0
        for i in range(len(s)):
            print(" the {}th loop ".format(i).center(40, '-'))
            print("used_char is: ", used_char)
            print("start is: ", start)
            print("max_len is:", max_len)
            print("current char is:", s[i])
            print("current string is:".ljust(30),s)
            print("current max substring is:".ljust(30), s[start:max_len])
            if s[i] in used_char and start <= used_char[s[i]]:
                print(s[i], " in used_char, add start")
                start = used_char[s[i]] + 1
            else:
                max_len = max(max_len, i-start+1)

            print("current string is:".ljust(30),s)
            print("current max substring is:".ljust(30), s[start:max_len])
            used_char[s[i]] = i
        return max_len

